def big_primefac_div(n):
    if isinstance(n, float):
        if n.is_integer():
            n = int(n)
        else:
            return "The number has a decimal part. No Results"

    n = abs(n)

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    divisors = [i for i in range(1, n) if n % i == 0]
    prime_factors = [i for i in divisors if is_prime(i)]

    if not prime_factors:
        return []

    max_prime_factor = max(prime_factors)
    max_divisor = max(i for i in divisors if i != n)

    return [max_prime_factor, max_divisor]

